INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3596710307302', 'Café pur arabica d\'Amérique du Sud', 'Corps, saveur et arôme constituent les critères distinctifs d\'un café, Auchan vous invite à découvrir sa sélection au travers de ces derniers, Le corps est lié à la densité, la texture et la persistance en bouche. La saveur, c\'est la sensation perçue par nos 300( papilles gustatives. L\'acidité es la saveur de base du café qui rappelle l\'acidité franche d\'un fruit (citron). L\'arôme est l\'ingrédient du plaisir de la dégustation de café. Ce sont toutes les notes ressenties par le nez et par le goût. Suivez le guide, lors de votre dégustation, votre nez découvrira, tout d\'abord, l\'odeur qui se dég du café, puis, en bouche vous apprécierez le corpc la saveur et l\'arôme. Café Amérique du Sud Elevé à haute altitude sur Cordillère des Andes, ce c offre un arôme subtil avec notes fruitées. Naturelle doux et très légèrement aci il reflète tout le savoir fair plantations traditionnell d\'Amérique Latine. corps', '', '5', '1', '33', '2', '8', '12', '12.18', '4.79527559055118', '', '0');

