INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3596710315000', 'Puree Saveur d\'autrefois aux epices, lait et creme', 'l\'etlll. conseils de préparation Pour 1 sachet de 125g : A la casserole : dans une casserole, porter à ébullition 400ml d\'eau et 400 ml de lait demi-écrémé. Retirer la casserole du feu. Laisser tiédir 2 à 3 minutes pour obtenir la température idéale. Verser les flocons en pluie tout en remuant le liquide. Laisser reposer 30 secondes sans remuer. Tourner doucement à raide d\'une cuillère. Votre purée est prête. Ne pas ajouter de sel, le produit en contient déjà. Au micro-onde : verser dans un récipient adapté au four à micro-ondes 400ml d\'eau et 400ml de lait demi-écrémé. Placer le récipient dans le four à micro-ondes et faire chauffer à puissance 750 watts pendant 5 à 6 minutes. Verser les flocons en pluie tout en remuant le liquide. Laisser reposer 30 secondes sans remuer. Tourner doucement à raide dlune cuillère. Votre purée est prête. Ne pas ajouter de sel, le produit en contient déjà. 1 sachet de flocons permet de préparer environ 4 assiettes', '', '2', '1.2', '74', '3.7', '0', '7', '2.35', '0.925196850393701', '', '0');

